import React from 'react'

function Projects() {
  return (
    <div className='w-full py-[4vw]'>
        <div className='w-full px-[4vw]'>
            <h1 className='text-[4vw] font-["Neue_Montreal"]'>Featured Projects</h1>

        </div>
    </div>
  )
}

export default Projects
